import React from 'react';
import './App.css';
import Menu from './menu';
import About from './About';
import Contact from './Contact';
import {BrowserRouter} from 'react-router-dom'

function App() {
  return (
    <div>
      <Menu/>
      <Home/>
      <About/>
      <Contact/>
    </div>
  );
}
const Home = () =>{
  return(
      <div className="contactstyle">
          <h2>Welcome to Home page.</h2>
      </div>
  )
}

export default App;
